import React from "react";
import PropTypes from "prop-types";

function Home(props) {
  return (
    <main className="index">
      <section className="index-banner">
        <h2>
          I am a web <br />
          developer
        </h2>
        <h1>React, Angular, React Native, Redux, MongoDB, ExpressJs</h1>
      </section>
    </main>
  );
}

Home.propTypes = {};

export default Home;
